import React, { useEffect, useState } from "react";
import "./EmailVerification.css";
import { useDispatch, useSelector } from "react-redux";
import { verifyUser } from "../features/auth/authSlice";
import {
  Navigate,
  useLocation,
  useNavigate,
  useParams,
} from "react-router-dom";

function EmailVerification({
  email,
  emailVerPage,
  setEmailVerPage,
  setMainClass,
}) {
  const dispatch = useDispatch();

  const [timeout, setTimeout] = useState(false);

  const sendLinkBtn = () => {
    // //console.log("Send Btn");
    dispatch(verifyUser());

    let time = 0;

    const interval = setInterval(() => {
      // //console.log("Time : ", time);

      if (time === 60) {
        setTimeout(true);
        clearInterval(interval);
      }

      time++;
    }, 2000);
  };

  return (
    <div className="email-ver-card">
      <p> Verify Email Address to Continue... </p>
      <div className="email-ver-email-icon">
        <img
          alt=""
          src="data:image/png;base64,"
        />
      </div>
      <div className="email-text-box">
        <input type="text" name="email" id="" defaultValue={email} disabled />
      </div>
      <div className="email-ver-buttons">
        <input
          type="button"
          value={timeout ? "Resend Link" : "Send Link"}
          id="send-link-btn"
          onClick={sendLinkBtn}
        />
        <input
          type="button"
          value="Back"
          id="back-btn"
          onClick={() => {
            setEmailVerPage(!emailVerPage);
            setMainClass("place-order-page");
          }}
        />
      </div>
      {timeout ? (
        <>
          <div
            style={{
              width: "fit-content",
              marginLeft: "auto",
              marginRight: "auto",
              marginTop: "2px",
            }}
          >
            Timeout, Resend Verification Link...
          </div>
        </>
      ) : (
        <></>
      )}
    </div>
  );
}

export function EmailVerificationReg({ email, setBlur }) {
  const dispatch = useDispatch();
  const params = useLocation();
  const navigate = useNavigate();

  const [timeout, setTimeout] = useState(false);

  // //console.log("Params : ", params);
  const { isVerified } = useSelector((state) => state.auth);

  useEffect(() => {
    if (isVerified) {
      // //console.log("User Verification Done, Redirecting...");
      navigate("/");
      // setBlur(false);
    }
  });

  let interval;

  const sendLinkBtn = () => {
    // //console.log("Send Btn");
    dispatch(verifyUser());

    let time = 0;

    interval = setInterval(() => {
      if (time === 60) {
        setTimeout(true);
        clearInterval(interval);
      }

      time++;
    }, 2000);
  };

  const handleSkip = () => {
    setBlur(false);
    clearInterval(interval);
  };

  return (
    <div className="email-ver-card">
      <p> Verify Email Address to Continue... </p>
      <div className="email-ver-email-icon">
        <img
          alt=""
          src="data:image/png;base64,"
        />
      </div>
      <div className="email-text-box">
        <input
          type="text"
          name="email"
          id=""
          defaultValue={params.state.email}
          disabled
        />
      </div>
      <div className="email-ver-buttons">
        <input
          type="button"
          value={timeout ? "Resend Link" : "Send Link"}
          id="send-link-btn"
          onClick={sendLinkBtn}
        />
        <input type="button" value="Skip" id="back-btn" onClick={handleSkip} />
      </div>
      {timeout ? (
        <>
          <div
            style={{
              width: "fit-content",
              marginLeft: "auto",
              marginRight: "auto",
              marginTop: "2px",
            }}
          >
            Timeout, Resend Verification Link...
          </div>
        </>
      ) : (
        <></>
      )}
    </div>
  );
}

export default EmailVerification;
